import React, { useState, useEffect } from 'react';
import { Outlet, useNavigate } from 'react-router-dom';
import { Navbar, Container, Button, Offcanvas, Nav } from 'react-bootstrap';
// Importamos los iconos que usaremos
import { 
  List as MenuIcon, 
  HouseFill, 
  Robot, 
  BookmarkStar, 
  GraphUp, 
  BoxArrowRight,
  QuestionCircleFill // Un √≠cono por defecto
} from 'react-bootstrap-icons';
import { LinkContainer } from 'react-router-bootstrap';

function MainLayout() {
  const [showMenu, setShowMenu] = useState(false);
  const [menuItems, setMenuItems] = useState([]);
  const navigate = useNavigate();

  // 1. Carga el men√∫ desde el servidor
  useEffect(() => {
    const fetchMenu = async () => {
      try {
        // Asumimos que el servidor est√° en el puerto 3111
        const response = await fetch('http://localhost:3111/getMenu'); 
        
        if (!response.ok) throw new Error('No se pudo cargar el men√∫');
        
        // La data ahora incluye: intIdRow, strName, booleanVisible, strArchive
        const data = await response.json();
        setMenuItems(data.filter(item => item.booleanVisible));

      } catch (error) {
        console.error("Error fetching menu:", error);
      }
    };
    fetchMenu();
  }, []);

  // 2. Funciones para el Offcanvas (men√∫) y Logout
  const handleCloseMenu = () => setShowMenu(false);
  const handleShowMenu = () => setShowMenu(true);

  const handleLogout = () => {
    localStorage.removeItem('IdUser');
    alert('Has cerrado sesi√≥n.');
    navigate('/');
  };

  // 3. Mapeo de Nombres (DB) a Iconos (React)
  // Esta funci√≥n solo asigna un icono basado en el texto visible
  const getMenuIcon = (strName) => {
    switch (strName) {
      case 'Inicio':
        return <HouseFill className="me-2" />;
      case 'Asistente IA':
        return <Robot className="me-2" />;
      case 'Mi Recetario':
        return <BookmarkStar className="me-2" />;
      case 'Monitor de Calor√≠as':
        return <GraphUp className="me-2" />;
      default:
        return <QuestionCircleFill className="me-2" />;
    }
  };

  return (
    <>
      {/* ===== BARRA DE NAVEGACI√ìN SUPERIOR ===== */}
      <Navbar bg="success" variant="dark" expand={false} sticky="top">
        <Container fluid>
          <Button variant="outline-light" onClick={handleShowMenu}>
            <MenuIcon size={24} />
          </Button>
          <Navbar.Brand href="#home" className="mx-auto">
            üë®‚Äçüç≥ Tu Chef Virtual
          </Navbar.Brand>
          <Button variant="outline-light" onClick={handleLogout}>
            <BoxArrowRight size={24} />
          </Button>
        </Container>
      </Navbar>

      {/* ===== MEN√ö LATERAL DESPLEGABLE (Offcanvas) ===== */}
      <Offcanvas show={showMenu} onHide={handleCloseMenu}>
        <Offcanvas.Header closeButton>
          <Offcanvas.Title>Men√∫ Principal</Offcanvas.Title>
        </Offcanvas.Header>
        <Offcanvas.Body>
          <Nav className="flex-column">
            
            {/* Iteramos y construimos el men√∫ desde la DB */}
            {menuItems.map((item) => {
              const icon = getMenuIcon(item.strName);
              // ¬°Aqu√≠ usamos el strArchive de la DB para la ruta!
              const path = `/app/${item.strArchive}`; 

              return (
                <LinkContainer to={path} key={item.intIdRow} onClick={handleCloseMenu}>
                  <Nav.Link className="d-flex align-items-center fs-5 my-1">
                    {icon}
                    {item.strName} {/* El texto visible */}
                  </Nav.Link>
                </LinkContainer>
              );
            })}
          </Nav>
        </Offcanvas.Body>
      </Offcanvas>

      {/* ===== CONTENEDOR DE CONTENIDO PRINCIPAL ===== */}
      {/* Este es el "div" que cambia (Outlet) */}
      <main>
        <Outlet />
      </main>
    </>
  );
}

export default MainLayout;
